import "./Form.css";

const Form = () => {
  return (
    <div className="form">
      <select className="form__select">
        <option>+</option>
        <option>-</option>
      </select>
      <input
        className="form__input form__input--desc"
        placeholder="Add description"
      ></input>
      <input
        className="form__input form__input--value"
        placeholder="Value"
        type="number"
      ></input>
      <button className="form__button">
        <i class="fa fa-solid fa-check fa-1x"></i>
      </button>
    </div>
  );
};

export default Form;
